import { Component } from '@angular/core';

@Component({
  selector: 'app-contactus',
  templateUrl: './contactus.component.html',
  styleUrls: ['./contactus.component.css']
})
export class ContactusComponent {

}
<div class="contactu">
  <div class="title">
    <h2>Get in Touch</h2>
  </div>
  <div class="box">
    <div class="contact form"></div>

  </div>
</div>
